<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="utf-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Yew App</title>
    <base href="/" />

    <!-- Preload and modulepreload -->
    <link rel="modulepreload" href="imsa-map-d0f819793dfd23c7.js" crossorigin="anonymous">
    <link rel="preload" href="imsa-map-d0f819793dfd23c7_bg.wasm" crossorigin="anonymous" as="fetch" type="application/wasm">
</head>
<body>
    <div id="root"></div>

    <!-- Script to load the WebAssembly module -->
    <script type="module">
        import init, * as bindings from './imsa-map-d0f819793dfd23c7.js';
        const wasm = await init('./imsa-map-d0f819793dfd23c7_bg.wasm');
        window.wasmBindings = bindings;
        dispatchEvent(new CustomEvent("TrunkApplicationStarted", { detail: { wasm } }));
    </script>
</body>
</html>
